import React from 'react';
import styled from 'styled-components';

function Header() {
	return (
		<header className='header'>
			<img src='' alt='logo' className='header-icon' />
			<ul className='header-menu'>
				<li className='header-menu__item'>Главная</li>
				<li className='header-menu__item'>Технология</li>
				<li className='header-menu__item'>График полетов</li>
				<li className='header-menu__item'>Гарантии</li>
				<li className='header-menu__item'>О компании</li>
				<li className='header-menu__item'>Контакты</li>
			</ul>
		</header>
	);
}


const StyledButton = styled.button`
  background-color: #ff0000;
  color: #ffffff;
  padding: 10px;
  border: none;
  border-radius: 4px;

  /* You can use SCSS features here */
  &:hover {
    background-color: darken(#ff0000, 10%);
  }
`;

export default Header;
